// import { SearchOutlined } from '@ant-design/icons';
// import { Button, Tooltip } from 'antd';
import React, { Component } from 'react'
import './index.css'

export default class Home extends Component {
  render() {
    return (
      <div className="home-subnav">
        <ul className="home-subnav-left">
          <li><a href="javascript:;">全部</a></li>
          <li><a href="javascript:;">信息管理</a></li>
          <li><a href="javascript:;">研发设计</a></li>
          <li><a href="javascript:;">生产控制</a></li>
          <li><a href="javascript:;">嵌入式软件</a></li>
        </ul>
        <div className="home-subnav-right">
          <input type="text" placeholder='搜索'/>
          {/* <Tooltip title="search">
            <Button shape="circle" icon={<SearchOutlined />} />
        </Tooltip> */}
        </div>
      </div>
    )
  }
}
